class ComponentConfiguration {
    /**
     * @type boolean
     */
    dontConfigEventsOnError;
    /**
     * @type boolean
     */
    dontAutoInitialize;
    /**
     * @type boolean
     */
    dontReloadFromState;
    /**
     * @type string
     */
    stateChangeRequest = "UPDATE";
    /**
     * @type boolean
     */
    clearChildrenOnReset;
    /**
     * @type boolean
     */
    updateViewOnce;
    /**
     * @type boolean
     */
    skipOwnViewUpdates;
}